Plot: On August 15, 1944 the 517th Parachute Regimental Combat Team (PRCT) jumped over the south of France. Their mission was to support and protect the Allied Troops marching to Berlin. Landing in enemy territory, they fell under immediate attack. In their effort to complete the mission and rendez-vous with their unit, three isolated paratroopers come across a group of French resistants in desperate need. They decide to help liberate some of the captive Partisans. Doing so they risk their lives in an effort to live the Airborne Creed
